    /**
     * Run the database seeds.
     */
    public function run(): void
    {
        $users = $this->getData();
        $password = Hash::make('password');

        $cis = [];
        foreach ($users as $k => $user) {
            $cis[] = $user['ci'];
            $users[$k]['password'] = $password;
        }

        User::insert($users);

        $role = Role::first();
        $userIds = User::whereIn('ci', $cis)->select('id')->get()->pluck('id');


        $phones = [];
        $records = [];
        foreach ($userIds as $id) {

            /* $phones[] = [
                'number' => ((string)fake()->phoneNumber()),
                'user_id' => $id
            ]; */

            $records[] = [
                'model_id' => $id,
                'model_type' => User::class,
                'role_id' => $role->id
            ];
        }

        /* Phone::insert($phones); */
        \DB::table("model_has_roles")->insert($records);
    }

